    'catalog/model/report/statistics' => \OpenCart\Catalog\Model\Report\ModelReportStatistics::class,
    'catalog/model/setting/api' => \OpenCart\Catalog\Model\Setting\ModelSettingApi::class,
    'catalog/model/setting/event' => \OpenCart\Catalog\Model\Setting\ModelSettingEvent::class,
    'catalog/model/setting/extension' => \OpenCart\Catalog\Model\Setting\ModelSettingExtension::class,
    'catalog/model/setting/module' => \OpenCart\Catalog\Model\Setting\ModelSettingModule::class,
    'catalog/model/setting/setting' => \OpenCart\Catalog\Model\Setting\ModelSettingSetting::class,
    'catalog/model/setting/store' => \OpenCart\Catalog\Model\Setting\ModelSettingStore::class,
    'catalog/model/tool/image' => \OpenCart\Catalog\Model\Tool\ModelToolImage::class,
    'catalog/model/tool/online' => \OpenCart\Catalog\Model\Tool\ModelToolOnline::class,
    'catalog/model/tool/upload' => \OpenCart\Catalog\Model\Tool\ModelToolUpload::class,
];

$list = [];

foreach ($models as $alias => $class) {
    $methods = get_class_methods($class);

    $list[] = sprintf(
        "\t'%s' => [\%s::class, null]," . PHP_EOL,
        $alias,
        $class
    );

    foreach ($methods as $method) {
        if (strpos($method, '__') === 0) {
            continue;
        }

        $list[] = sprintf(
            "\t'%s/%s' => [\%s::class, '%s']," . PHP_EOL,
            $alias,
            $method,
            $class,
            $method
        );
    }
}

file_put_contents('models.txt', $list);
